        const esquema = {
            "type": "object",
            "properties": {
              "nombre": {
                "type": "string"
              }
            },
            "required": [
              "nombre"
            ]
          };
        const path = './archivos/archivo-json2.json';
        chai.assert.jsonSchemaFile(path, esquema, 'descripción de error');
    });

});

